import React from "react";
import GoogleMap from './components/GoogleMap';

import Marker from './components/Marker';
import Navigation from './components/Navigation';
import Stats from './components/Stats';
import { apiIsLoaded } from './Functions';

import "./App.css";

import { mapStyles } from './mapstyles.js';

const API_KEY = "CC57D2038B76DBBD253D6A587";
const API_URL = "https://developer.trimet.org/ws/v2/vehicles/appID/"+API_KEY;
const defaultCenter = [45.519526,-122.677040];


export class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoaded: false,
      vehicles: []
    };
  }



  render() {
    let { isLoaded, vehicles } = this.state;


      return (
        <div className="container">
          <GoogleMap
            defaultZoom={12}
            defaultCenter={defaultCenter}
            defaultOptions={{
              styles: mapStyles
            }}
            yesIWantToUseGoogleMapApiInternals

            >
            {vehicles.map(vehicle => (
              <Marker 
              key={vehicle.vehicleID}
              text={vehicle.signMessageLong}
              type={vehicle.type}
              lat={vehicle.latitude}
              lng={vehicle.longitude}
              data={vehicle}
              />
            ))}
          </GoogleMap>
          <Navigation />
          <Stats data={vehicles} />
        </div>
      );

  }
}

export default App;
